import React from 'react';
import 'font-awesome/css/font-awesome.min.css';
import './sidebar.css';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faHouseUser, faChartLine } from '@fortawesome/free-solid-svg-icons';
import { faUser } from '@fortawesome/free-regular-svg-icons'; 

const Sidebar = () => {
  return (
    <div className="sidebar">
      <ul>
        <li><a href="#"><FontAwesomeIcon icon={faHouseUser} /> Home Page</a></li>
        <li><a href="#"><FontAwesomeIcon icon={faUser} /> Recursos Humanos</a></li>
        <li><a href="#"><FontAwesomeIcon icon={faChartLine} /> Despesas</a></li>
        <li><a href="#"><i className="fas fa-box"></i> Estoque</a></li>
        <li><a href="#"><i className="fas fa-headset"></i> Suporte</a></li>
      </ul>
    </div>
  );
}

export default Sidebar;
